const dataset = {
    header:{
        nav:{
            logo: "./assets/img/logo.png",
            icon: [{
                cart: "./assets/img/icon/top_cart.png",
                search: "./assets/img/icon/top_search.png",
                user: "./assets/img/icon/top_user.png",
                wish: "./assets/img/icon/top_wish.png"
            }]
        },
    }
}

export default dataset;
